INSERT INTO DS_BASE_DICT_DATA(NAME, ID, PID, LABEL, MARK, LEVEL, STATUS, SEQ, MEMO) VALUES ('GMJJHY', 'A', NULL, '农、林、牧、渔业', NULL, 1, 1, 0, '本门类包括01～05大类');
INSERT INTO DS_BASE_DICT_DATA(NAME, ID, PID, LABEL, MARK, LEVEL, STATUS, SEQ, MEMO) VALUES ('GMJJHY', 'B', NULL, '采矿业', NULL, 1, 1, 0, '本类包括06～12大类，采矿业指对固体（如煤和矿物）、液体（如原油）或气体（如天然气）等自然产生的矿物的采掘；包括地下或地上采掘、矿井的运行，以及一般在矿址或矿址附近从事的旨在加工原材料的所有辅助性工作，例如碾磨、选矿和处理，均属本类活动；还包括使原料得以销售所需的准备工作；不包括水的蓄集、净化和分配，以及地质勘查、建筑工程活动');
INSERT INTO DS_BASE_DICT_DATA(NAME, ID, PID, LABEL, MARK, LEVEL, STATUS, SEQ, MEMO) VALUES ('GMJJHY', 'C', NULL, '制造业', NULL, 1, 1, 0, '本门类包括13～43大类，指经物理变化或化学变化后成为新的产品，不论是动力机械制造，还是手工制作；也不论产品是批发销售，还是零售，均视为制造建筑物中的各种制成品、零部件的生产应视为制造，但在建筑预制品工地，把主要部件组装成桥梁、仓库设备、铁路与高架公路、升降机与电梯、管道设备、喷水设备、暖气设备、通风设备与空调设备，照明与安装电线等组装活动，以及建筑物的装置，均列为建筑活动。本门类包括机电产品的再制造，指将废旧汽车零部件、工程机械、机床等进行专业化修复的批量化生产过程，再制造的产品达到与原有新产品相同的质量和性能');
